import logo from './logo.svg';
import './App.css';
import{Header} from './Header';
import footer from './footer';

function App(){
  return(
    <div className="main">
      <Header/>
      <footer/>
      <container fluid>
        <container>
          <row>
            <col className='col-12 text-center py-4'>
              <h1>Our Courses</h1>
            </col>
          </row>
        </container>

      </container>

    </div>
  )
}
